import React, { useEffect } from "react";
import PropTypes from "prop-types";
import LoginForm from "./forms/LoginForm";
import { checkAuth } from "../routes/checker";

function HomePage() {
  // componentWillMount() {
  //   checkAuth();
  // }
  useEffect(() => {
    checkAuth();
  });

  return (
    <div className="container">
      <h3> About us </h3>
      <div>
        <h6> Ruby One</h6>
        <p>
          Pay R200.00 once off joining fee 6 X members joins under your name Now
          your Ruby one is now completed Benefits of Ruby One R200.00 Cash back
          40% x6 bonus = R480.00 Total pay-out R200.00 + R480.00 =R680.00
        </p>
      </div>
      <div>
        Ruby Two
        <p>
          From the profit you've gained from Ruby one Pay R300.00
          Lead/help/teach your six members to recruit their own six members.
          Once your six members joins you at this stage... You advance to Ruby
          Three Benefits of Ruby Two R300.00 Cash back 40% x6 bonus =R750.00
          Total pay-out R750.00 + R300.00 =R1 020.00
        </p>
      </div>
      <div>
        <h6> Ruby Three</h6>
        <p>
          Pay R500.00 Once your six members joins you at this stage... You
          advance to Ruby Four Benefits of Ruby Three R500.00 Cash back 40% x6
          bonus =R1 200.00 Total pay-out R1 200.00 + R500.00 =R1 700.00
        </p>
      </div>
    </div>
  );
}

HomePage.propTypes = {};

export default HomePage;
